WOOWEB-PRO V3 is a software router and firewall for professional Internet sharing with content-filtering option.It allows an entire LAN to connect to the Internet with high management and supervision of users, sites and connection times.The reporting firewall provides a strong protection to your computers.Two filtering systems based on key words and/or content categories allow you to keep undesirable sites outside your Intranet.You can block the access to pornographic, hate, violent contents, etc. with a simple mouse click.
